import React from 'react';
import logo from '../logo.svg';

class HeaderComponent extends React.Component {
  constructor(props){
    super(props);
  }
  render () {
    return (
    <div>
      <h1 className="logo">Logo</h1>
      <div className="menu">
        <a>Home</a>
        <a>Products</a>
        <a>Company</a>
      </div>
      <button type="button" >Contact</button>
    </div>
    );
  }
}

export { HeaderComponent }
